import React, { Component } from 'react';
import './App.css';
import { getAllStudents } from './client';

class App extends Component{

  state = {
    students: []
  }

  fetchStudents = () => {
    getAllStudents()
    .then(res => res.json()
    .then(students => {
      this.setState({
        students
      })
    }));
  }

  render(){

    return <h1>HELLO</h1>
  }


}

export default App;
